webpackJsonp([18777356414487],{1323:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2007-06-11-new-shimano-ultegra/index.md absPath of file >>> MarkdownRemark",html:"<p><a href=\"http://www.bike-community.net/forum/showthread.php?t=189\">Shimano has released a new version</a> of their Ultegra group. It comes in an ice grey color which is pretty cool and a bit lighter. The group includes an Ultegra branded compact crank which I am assuming will replace the R700.</p>\n<p>I made a visit to a Trek dealer to see the new Madone 5.2 and 5.5. They hadn't built up the bikes yet, but the new Ultegra components were attached and looked pretty sweet.</p>\n<p>My question is when does Shimano plan on releasing a new Dura Ace? At the very least a Dura Ace level compact crank would be nice. Campy Record weighs less (but also quite a bit more expensive, at least here in the states). Isn't it time Shimano caught up and brought us the next generation of top level components?</p>",frontmatter:{title:"New Shimano Ultegra",date:"June 11, 2007",imageUrl:null,image:null}}},pathContext:{path:"/new-shimano-ultegra"}}}});
